  and maintains LiDAR data including orthophotos in coastal areas of the United States
  and its territories. The Corps acquires this data in the course of performing its
  mission of Flood Control, Navigation, Environmental Engineering, and support for
  the Army and others. These data were collected along the Indiana, Michigan, Ohio
